import * as types from './../constants/ActionType';

var initialState = [
    {
        product: {
            id: 1,
            name: 'iPhone 6 Plus',
            image: 'data:image/jpeg;base64,',
            description: "Here is product 666 newst of us",
            price: 500,
            inventory: 10,
            rating: 3
        },
        quantity : 10

    }
]

const products = (state = initialState, action) => {
    switch (action.type) {
        case types.ADD_TO_CART:
            console.log(action);
            
            return [...state];
        default:
            return [...state];
    }

}

export default cart;
